/**
 * @description 回退按钮组件
 */
import React from 'react';
import PropTypes from 'prop-types';
import { useHistory } from 'react-router-dom';
import './index.less';

const Back = ({ ...props }) => {
  const history = useHistory();

  return (
    <div className='back'>
      <div className='back-left'></div>
      <div className='back-right'></div>
    </div>
  );
};
export default Back;
